"use client"

import { useState, useEffect, useCallback } from "react"
import axios from "axios"
import "../Admin/EmployeeDashboard.css";

const RenterDashboard = () => {
  const [activeTab, setActiveTab] = useState('profile');
  const savedUser = JSON.parse(localStorage.getItem("user"));
  const [user, setUser] = useState(savedUser);

  const [car, setCar] = useState({
    brand: "",
    model: "",
    year: "",
    price: "",
    description: "",
    features: "",
    images: [],
    location: "",
  });
  const [imageFiles, setImageFiles] = useState([]);

  // Fix 1: Define fetchUserCars with useCallback before using it in useEffect
  const fetchMyOrders = useCallback(async () => {
    if (!user?._id) return; // Add a guard clause to prevent API call without user ID
    
    try {
      const response = await axios.get(`http://localhost:5000/api/orders/orders${user._id}`);
      setCars(response.data);
    } catch (error) {
      console.error("Error fetching cars:", error);
    }
  }, [user?._id]); // Only re-create this function if user._id changes

  useEffect(() => {
    fetchMyOrders();
  }, [fetchMyOrders]); // Now fetchUserCars is properly memoized

  const updateUserDetails = async () => {
    try {
      await axios.put(`http://localhost:5000/api/auth/users/${user?._id}`, user);
      alert("User details updated!");
    } catch (error) {
      console.error("Error updating user details:", error);
      alert("Error updating profile");
    }
  };

  

  const handleFileChange = (e) => {
    const files = Array.from(e.target.files);
    setImageFiles(files);
    
    // Create preview URLs
    const imageUrls = files.map(file => URL.createObjectURL(file));
    setCar({ ...car, images: imageUrls });
  };
  
  return (
    <div >
        
       <div className="dashboard-container"></div>
       <h2>Owner Dashboard</h2>
      
      <div className="dashboard-header">
      
        <div className="dashboard-tabs">
          <button 
            className={`tab-button ${activeTab === 'profile' ? 'active' : ''}`}
            onClick={() => setActiveTab('profile')}
          >
            Profile
          </button>
          <button 
            className={`tab-button ${activeTab === 'myorders' ? 'active' : ''}`}
            onClick={() => setActiveTab('myorders')}
          >
            My Orders
          </button>
         
        </div>
      </div>

      {activeTab === 'profile' && (
        <div className="profile-section">
          <h3>Personal Information</h3>
          <div className="form-group">
            <label>Full Name</label>
            <input 
              type="text" 
              value={user?.name || ""} 
              onChange={(e) => setUser({ ...user, name: e.target.value })} 
              placeholder="Enter your full name"
            />
          </div>
          <div className="form-group">
            <label>Email Address</label>
            <input 
              type="email" 
              value={user?.email || ""} 
              onChange={(e) => setUser({ ...user, email: e.target.value })} 
              placeholder="Enter your email"
            />
          </div>
          <button className="update-profile-button" onClick={updateUserDetails}>
            Update Profile
          </button>
        </div>
      )}

      {activeTab === 'myorders' && (
        <div className="add-car-section">
          <h3>Add New Car</h3>
          <div className="car-form">
            <div className="form-row">
              <div className="form-group">
                <label>Brand</label>
                <input 
                  type="text" 
                  value={car.brand}
                  onChange={(e) => setCar({ ...car, brand: e.target.value })} 
                  placeholder="e.g. Toyota"
                />
              </div>
              <div className="form-group">
                <label>Model</label>
                <input 
                  type="text" 
                  value={car.model}
                  onChange={(e) => setCar({ ...car, model: e.target.value })} 
                  placeholder="e.g. Camry"
                />
              </div>
              <div className="form-group">
              <label>Location</label>
              <input 
                type="text" 
                value={car.location}
                onChange={(e) => setCar({ ...car, location: e.target.value })} 
                placeholder="e.g. New York, NY"
              />
            </div>
            </div>
            <div className="form-row">
              <div className="form-group">
                <label>Year</label>
                <input 
                  type="number" 
                  value={car.year}
                  onChange={(e) => setCar({ ...car, year: e.target.value })} 
                  placeholder="e.g. 2023"
                />
              </div>
              <div className="form-group">
                <label>Price ($)</label>
                <input 
                  type="number" 
                  value={car.price}
                  onChange={(e) => setCar({ ...car, price: e.target.value })} 
                  placeholder="e.g. 25000"
                />
              </div>
              <div className="form-group">
              <label>Description</label>
              <textarea 
                value={car.description}
                onChange={(e) => setCar({ ...car, description: e.target.value })} 
                placeholder="Describe your car's condition, history, etc."
              />
            </div>
            </div>
            <div className="form-row">
              <div className="form-group">
                <label>Features (comma separated)</label>
                <input 
                  type="text" 
                  value={car.features}
                  onChange={(e) => setCar({ ...car, features: e.target.value })} 
                  placeholder="e.g. Leather seats, Sunroof, Navigation"
                />
              </div>
              <div className="form-group">
                <label>Images</label>
                <div className="image-upload">
                  <input 
                    type="file" 
                    multiple 
                    onChange={handleFileChange} 
                    id="car-images"
                    className="file-input"
                  />
                  
                </div>
              </div>
              <div className="form-group">
              {car.images.length > 0 && (
                <div className="image-previews">
                  {car.images.map((url, index) => (
                    <img 
                      key={index} 
                      src={`http://localhost:5000/${url}`}  
                      alt={`Preview ${index}`} 
                      className="image-preview"
                    />
                  ))}
                </div>
              )}
               </div>
             
            </div>
            <div className="file-button-section">
            <label htmlFor="car-images" className="file-label">
                  <span>Choose Files</span>
                </label>
                <span className="file-info">
                  {imageFiles.length > 0 ? `${imageFiles.length} files selected` : "No files chosen"}
                </span>
                </div>
            
          </div>
        </div>
      )}

     
    </div>
    
  );
};

export default RenterDashboard;
